import React from 'react';
import '../../Body.css';
import './AddAuthor.css';
import Header from '../../../Components/Header/Header';
import Footer from '../../../Components/Footer/Footer';

export default function AddAuthor (){

    return(

        <div>

            <Header />

            <div className='body add-author'>

                <div className='add-author-content edit-inputs'>

                    <input className='edit-publication-inputs' type="text" placeholder='First Name' />
                    <input className='edit-publication-inputs' type="text" placeholder='Last Name' />
                    <label className='add-new-reservation-labels' for="enddate">Start Date:</label>
                   <input className='add-new-reservation-inputs' type="date" id="startdate" name="startdate" placeholder='Start Date' />
                    <input className='edit-publication-inputs' type="text" placeholder='Nationality' />
                        
                    <div className='add-author-content edit-buttons'>
                        <button className='edit-publication-buttons'>Edit</button>
                        <button className='edit-publication-buttons'>Save Changes</button>
                        <button className='edit-publication-buttons'>Add</button>
                    </div>

                </div>

            </div>

            <Footer />

        </div>

    )

}
